INSERT INTO `language_content` VALUES (1136, 1266, 1, 'Q: Is this free?', 1);
INSERT INTO `language_content` VALUES (1137, 1267, 1, 'A: Yes, uploading and downloading is 100% Free for all users. We offer premium accounts which allows for greater flexibility with uploading/downloading.', 1);
INSERT INTO `language_content` VALUES (1138, 1268, 1, 'Q: Will my files be removed?', 1);
INSERT INTO `language_content` VALUES (1139, 1269, 1, 'A: Free/non accounts files are kept for [[[KEPT_FOR_DAYS_FREE]]] days. Premium accounts files are kept for [[[KEPT_FOR_DAYS_PAID]]] days.', 1);
INSERT INTO `language_content` VALUES (1140, 1270, 1, 'Q: How many files can I upload?', 1);
INSERT INTO `language_content` VALUES (1141, 1271, 1, 'A: You can upload as many files as you want, as long as each one adheres to the Terms of Service and the maximum file upload size.', 1);
INSERT INTO `language_content` VALUES (1142, 1272, 1, 'Q: Which files types am I allowed to upload?', 1);
INSERT INTO `language_content` VALUES (1143, 1273, 1, 'Any', 1);
INSERT INTO `language_content` VALUES (1144, 1274, 1, 'A: You may upload the following types of files: [[[FILE_TYPES]]].', 1);
INSERT INTO `language_content` VALUES (1145, 1275, 1, 'Q: Are there any restrictions to the size of my uploaded files?', 1);
INSERT INTO `language_content` VALUES (1146, 1276, 1, 'A: Each file you upload must be less than [[[MAX_UPLOAD_SIZE_FREE]]] in size for free/non accounts or less than [[[MAX_UPLOAD_SIZE_PAID]]] in size for premium accounts. If it is greater than that amount, your file will be rejected.', 1);
INSERT INTO `language_content` VALUES (1147, 1277, 1, 'Q: Can I upload music or videos?', 1);
INSERT INTO `language_content` VALUES (1148, 1278, 1, 'A: Yes. Music and video hosting is permitted as long as you own the copyright on the content and it adheres to the terms and conditions.', 1);
INSERT INTO `language_content` VALUES (1149, 1279, 1, 'Q: There are some files on our servers which may have been subject to copyright protection, how can I notify you of them?', 1);
INSERT INTO `language_content` VALUES (1150, 1280, 1, 'A: Via our <a href=\"report_file\">report abuse</a> pages.', 1);
