INSERT INTO `language_content` VALUES (3460, 1266, 0, 'Q: Is this free?', 0);
INSERT INTO `language_content` VALUES (3461, 1267, 0, 'A: Yes, uploading and downloading is 100% Free for all users. We offer premium accounts which allows for greater flexibility with uploading/downloading.', 0);
INSERT INTO `language_content` VALUES (3462, 1268, 0, 'Q: Will my files be removed?', 0);
INSERT INTO `language_content` VALUES (3463, 1269, 0, 'A: Free/non accounts files are kept for [[[KEPT_FOR_DAYS_FREE]]] days. Premium accounts files are kept for [[[KEPT_FOR_DAYS_PAID]]] days.', 0);
INSERT INTO `language_content` VALUES (3464, 1270, 0, 'Q: How many files can I upload?', 0);
INSERT INTO `language_content` VALUES (3465, 1271, 0, 'A: You can upload as many files as you want, as long as each one adheres to the Terms of Service and the maximum file upload size.', 0);
INSERT INTO `language_content` VALUES (3466, 1272, 0, 'Q: Which files types am I allowed to upload?', 0);
INSERT INTO `language_content` VALUES (3467, 1273, 0, 'Any', 0);
INSERT INTO `language_content` VALUES (3468, 1274, 0, 'A: You may upload the following types of files: [[[FILE_TYPES]]].', 0);
INSERT INTO `language_content` VALUES (3469, 1275, 0, 'Q: Are there any restrictions to the size of my uploaded files?', 0);
INSERT INTO `language_content` VALUES (3470, 1276, 0, 'A: Each file you upload must be less than [[[MAX_UPLOAD_SIZE_FREE]]] in size for free/non accounts or less than [[[MAX_UPLOAD_SIZE_PAID]]] in size for premium accounts. If it is greater than that amount, your file will be rejected.', 0);
INSERT INTO `language_content` VALUES (3471, 1277, 0, 'Q: Can I upload music or videos?', 0);
INSERT INTO `language_content` VALUES (3472, 1278, 0, 'A: Yes. Music and video hosting is permitted as long as you own the copyright on the content and it adheres to the terms and conditions.', 0);
INSERT INTO `language_content` VALUES (3473, 1279, 0, 'Q: There are some files on our servers which may have been subject to copyright protection, how can I notify you of them?', 0);
INSERT INTO `language_content` VALUES (3474, 1280, 0, 'A: Via our <a href=\"report_file\">report abuse</a> pages.', 0);
