INSERT INTO `language_content` VALUES (5876, 1266, 37, 'Q: Is this free?', 0);
INSERT INTO `language_content` VALUES (5877, 1267, 37, 'A: Yes, uploading and downloading is 100% Free for all users. We offer premium accounts which allows for greater flexibility with uploading/downloading.', 0);
INSERT INTO `language_content` VALUES (5878, 1268, 37, 'Q: Will my files be removed?', 0);
INSERT INTO `language_content` VALUES (5879, 1269, 37, 'A: Free/non accounts files are kept for [[[KEPT_FOR_DAYS_FREE]]] days. Premium accounts files are kept for [[[KEPT_FOR_DAYS_PAID]]] days.', 0);
INSERT INTO `language_content` VALUES (5880, 1270, 37, 'Q: How many files can I upload?', 0);
INSERT INTO `language_content` VALUES (5881, 1271, 37, 'A: You can upload as many files as you want, as long as each one adheres to the Terms of Service and the maximum file upload size.', 0);
INSERT INTO `language_content` VALUES (5882, 1272, 37, 'Q: Which files types am I allowed to upload?', 0);
INSERT INTO `language_content` VALUES (5883, 1273, 37, 'Any', 0);
INSERT INTO `language_content` VALUES (5884, 1274, 37, 'A: You may upload the following types of files: [[[FILE_TYPES]]].', 0);
INSERT INTO `language_content` VALUES (5885, 1275, 37, 'Q: Are there any restrictions to the size of my uploaded files?', 0);
INSERT INTO `language_content` VALUES (5886, 1276, 37, 'A: Each file you upload must be less than [[[MAX_UPLOAD_SIZE_FREE]]] in size for free/non accounts or less than [[[MAX_UPLOAD_SIZE_PAID]]] in size for premium accounts. If it is greater than that amount, your file will be rejected.', 0);
INSERT INTO `language_content` VALUES (5887, 1277, 37, 'Q: Can I upload music or videos?', 0);
INSERT INTO `language_content` VALUES (5888, 1278, 37, 'A: Yes. Music and video hosting is permitted as long as you own the copyright on the content and it adheres to the terms and conditions.', 0);
INSERT INTO `language_content` VALUES (5889, 1279, 37, 'Q: There are some files on our servers which may have been subject to copyright protection, how can I notify you of them?', 0);
INSERT INTO `language_content` VALUES (5890, 1280, 37, 'A: Via our <a href=\"report_file\">report abuse</a> pages.', 0);
