INSERT INTO `language_key` VALUES (1266, 'faq_q1_question', 'Q: Is this free?', 0, 1);
INSERT INTO `language_key` VALUES (1267, 'faq_q1_answer', 'A: Yes, uploading and downloading is 100% Free for all users. We offer premium accounts which allows for greater flexibility with uploading/downloading.', 0, 1);
INSERT INTO `language_key` VALUES (1268, 'faq_q2_question', 'Q: Will my files be removed?', 0, 1);
INSERT INTO `language_key` VALUES (1269, 'faq_q2_answer', 'A: Free/non accounts files are kept for [[[KEPT_FOR_DAYS_FREE]]] days. Premium accounts files are kept for [[[KEPT_FOR_DAYS_PAID]]] days.', 0, 0);
INSERT INTO `language_key` VALUES (1270, 'faq_q3_question', 'Q: How many files can I upload?', 0, 1);
INSERT INTO `language_key` VALUES (1271, 'faq_q3_answer', 'A: You can upload as many files as you want, as long as each one adheres to the Terms of Service and the maximum file upload size.', 0, 1);
INSERT INTO `language_key` VALUES (1272, 'faq_q4_question', 'Q: Which files types am I allowed to upload?', 0, 1);
INSERT INTO `language_key` VALUES (1273, 'faq_any', 'Any', 0, 0);
INSERT INTO `language_key` VALUES (1274, 'faq_q4_answer', 'A: You may upload the following types of files: [[[FILE_TYPES]]].', 0, 1);
INSERT INTO `language_key` VALUES (1275, 'faq_q5_question', 'Q: Are there any restrictions to the size of my uploaded files?', 0, 1);
INSERT INTO `language_key` VALUES (1276, 'faq_q5_answer', 'A: Each file you upload must be less than [[[MAX_UPLOAD_SIZE_FREE]]] in size for free/non accounts or less than [[[MAX_UPLOAD_SIZE_PAID]]] in size for premium accounts. If it is greater than that amount, your file will be rejected.', 0, 0);
INSERT INTO `language_key` VALUES (1277, 'faq_q6_question', 'Q: Can I upload music or videos?', 0, 1);
INSERT INTO `language_key` VALUES (1278, 'faq_q6_answer', 'A: Yes. Music and video hosting is permitted as long as you own the copyright on the content and it adheres to the terms and conditions.', 0, 1);
INSERT INTO `language_key` VALUES (1279, 'faq_q7_question', 'Q: There are some files on our servers which may have been subject to copyright protection, how can I notify you of them?', 0, 1);
INSERT INTO `language_key` VALUES (1280, 'faq_q7_answer', 'A: Via our <a href=\"report_file\">report abuse</a> pages.', 0, 0);
