INSERT INTO `language_key` VALUES (21143, 'email_items_url_process_contentv5', '\n            <table border=\"3\">\n            <tbody>\n            <tr>\n            <td>\n            <p>Yth. <strong>[[[SHARING_NAME]]]</strong><strong>,</strong></p>\n            <p>&nbsp;</p>\n            <p>Terima kasih atas kepercayaan Anda kepada Rumah Sakit Brawijaya Saharjo. Terlampir adalah Hasil Pemeriksaan&nbsp;<strong>[[[SHARING_RESULT]]]</strong>&nbsp;atas nama<strong>&nbsp;[[[SHARING_NAME]]]&nbsp;</strong>yang telah dilakukan pada tanggal<strong>&nbsp;[[[SHARING_CHECKUPDATE]]]</strong>.</p>\n            <p>Untuk memudahkan Anda, format BARU <em>password untuk melihat hasil pemeriksaan radiologi </em>Anda adalah <strong>DDMMYYYY</strong>. Silakan gunakan <em>password</em> sesuai petunjuk format di bawah ini untuk mengakses <em>hasil pemeriksaan </em>Anda.</p>\n            <p>Format password hasil pemeriksaan radiologi baru Anda adalah DDMMYYYY, di mana:</p>\n            <ul>\n            <li><strong>DD</strong> : Dua digit tanggal lahir Anda, contoh: 01</li>\n            <li><strong>MM</strong> : Dua digit bulan lahir Anda, contoh: 01</li>\n            <li><strong>YYYY</strong> : Empat digit tahun kelahiran Anda, contoh: 1986</li>\n            </ul>\n            <p><em>Password hasil pemeriksaan radiologi </em>berdasarkan contoh di atas adalah: <strong>01011986</strong>.</p>\n            <p>Hasil terlampir berupa gambar dan ekspertise dokter radiologi.</p>\n            <p>&nbsp;</p>\n            <p><strong>Url:</strong> <a href=\"[[[SHARING_URL]]]\">[[[SHARING_URL]]]</a></p>\n            <p>&nbsp;</p>\n            <p>Salam,</p>\n            <p>&nbsp;</p>\n            <p>&nbsp;</p>\n            <h3>Departemen Radiologi Rumah Sakit Brawijaya Saharjo</h3>\n            </td>\n            </tr>\n            </tbody>\n            </table>\n            <p><span style=\"color: #000000; background-color: #999999;\">RADIOLOGY DEPARTMENT BRAWIJAYA HOSPITAL SAHARJO Jl. Dr. Saharjo No.199, RW.1, tebet Bar., Kec. Tebet, Kota Jakarta Selatan, DKI Jakarta 12870 021- 3973-7890 0821-2221-1389 (Whats App Text Only) Pesan dikirim dariRadMED on 20/01/2021 04:17:40</span></p>\n            <p>Jangan balas email ini, karena tidak dipantau secara aktif. Silakan ajukan pertanyaan, saran atau komentar ke website. Terima kasih atas ketertarikan Anda pada RS Brawijaya Saharjo. Kami senang memiliki kesempatan yang berkelanjutan untuk melayani Anda.</p>\n            <p>&nbsp;</p>\n            <p>&nbsp;</p>\n            <table border=\"3\">\n            <tbody>\n            <tr>\n            <td>\n            <p>Dear <strong>[[[SHARING_NAME]]],</strong> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\n            <p>&nbsp;</p>\n            <p>Thank you for your trust in Brawijaya Hospital Saharjo. Attached here with is the <strong>[[[SHARING_RESULT]]]</strong> exam result in the name of <strong>[[[SHARING_NAME]]]</strong> which was performed on <strong>January 1st, 1970.</strong></p>\n            <p>For your convenience, the NEW password format for viewing your radiological exam results is <strong>DDMMYYYY</strong>. Please use the password according to the format instructions below to access your examination results.</p>\n            <p>The password format for your new radiology exam is <strong>DDMMYYYY</strong>, where:</p>\n            <ul>\n            <li><strong>DD</strong> : two digits of your birth date, example: 01</li>\n            <li><strong>MM</strong> : two digits of your birth month, example: 01</li>\n            <li><strong>YYYY</strong> : four digits of your birth year, example: 1986</li>\n            </ul>\n            <p>&nbsp;</p>\n            <p>The password for radiology exam based on the example above is: 01011986.</p>\n            <p>The attached results are medical images and report of the examination.</p>\n            <p><strong>Url:</strong> <a href=\"[[[SHARING_URL]]]\">[[[SHARING_URL]]]</a></p>\n            <p>&nbsp;</p>\n            <p>Best regards,</p>\n            <p>&nbsp;</p>\n            <p>&nbsp;</p>\n            <h3>Radiology Department Brawijaya Hospital Saharjo</h3>\n            </td>\n            </tr>\n            </tbody>\n            </table>\n            <p><span style=\"color: #000000; background-color: #999999;\">RADIOLOGY DEPARTMENT BRAWIJAYA HOSPITAL SAHARJO Jl. Dr. Saharjo No.199, RW.1, tebet Bar., Kec. Tebet, Kota Jakarta Selatan, DKI Jakarta 12870 021- 3973-7890 0821-2221-1389 (Whats App Text Only)\n            Pesan dikirim dariRadMED on 20/01/2021 04:17:40\n            </span></p>\n            <p>Do not reply to this email, as it is not actively monitored. Please direct questions, suggestions or comments to website. Thank you for your interest in Brawijaya Saharjo Hospital. We are pleased to have the continued opportunity to serve you.</p>', 0, 0);
INSERT INTO `language_key` VALUES (21144, 'subject_konten', '[[[SHARING_NAME]]] - Hasil pemeriksaan/Examination Result [[[SHARING_RESULT]]]', 0, 0);
INSERT INTO `language_key` VALUES (21145, 'account_file_details_share_via_email_contentv5', '\n            <table border=\"3\">\n            <tbody>\n            <tr>\n            <td>\n            <p>Yth. <strong>[[[SHARING_NAME]]]</strong><strong>,</strong></p>\n            <p>&nbsp;</p>\n            <p>Terima kasih atas kepercayaan Anda kepada Rumah Sakit Brawijaya Saharjo. Terlampir adalah Hasil Pemeriksaan&nbsp;<strong>[[[SHARING_RESULT]]]</strong>&nbsp;atas nama<strong>&nbsp;[[[SHARING_NAME]]]&nbsp;</strong>yang telah dilakukan pada tanggal<strong>&nbsp;[[[SHARING_CHECKUPDATE]]]</strong>.</p>\n            <p>Untuk memudahkan Anda, format BARU <em>password untuk melihat hasil pemeriksaan radiologi </em>Anda adalah <strong>DDMMYYYY</strong>. Silakan gunakan <em>password</em> sesuai petunjuk format di bawah ini untuk mengakses <em>hasil pemeriksaan </em>Anda.</p>\n            <p>Format password hasil pemeriksaan radiologi baru Anda adalah DDMMYYYY, di mana:</p>\n            <ul>\n            <li><strong>DD</strong> : Dua digit tanggal lahir Anda, contoh: 01</li>\n            <li><strong>MM</strong> : Dua digit bulan lahir Anda, contoh: 01</li>\n            <li><strong>YYYY</strong> : Empat digit tahun kelahiran Anda, contoh: 1986</li>\n            </ul>\n            <p><em>Password hasil pemeriksaan radiologi </em>berdasarkan contoh di atas adalah: <strong>01011986</strong>.</p>\n            <p>Hasil terlampir berupa gambar dan ekspertise dokter radiologi.</p>\n            <p>&nbsp;</p>\n            <p><strong>Url:</strong> <a href=\"[[[FILE_URL]]]\">[[[FILE_URL]]]</a></p>\n            <p>&nbsp;</p>\n            <p>Salam,</p>\n            <p>&nbsp;</p>\n            <p>&nbsp;</p>\n            <h3>Departemen Radiologi Rumah Sakit Brawijaya Saharjo</h3>\n            </td>\n            </tr>\n            </tbody>\n            </table>\n            <p><span style=\"color: #000000; background-color: #999999;\">RADIOLOGY DEPARTMENT BRAWIJAYA HOSPITAL SAHARJO Jl. Dr. Saharjo No.199, RW.1, tebet Bar., Kec. Tebet, Kota Jakarta Selatan, DKI Jakarta 12870 021- 3973-7890 0821-2221-1389 (Whats App Text Only) Pesan dikirim dariRadMED on 20/01/2021 04:34:02</span></p>\n            <p>Jangan balas email ini, karena tidak dipantau secara aktif. Silakan ajukan pertanyaan, saran atau komentar ke website. Terima kasih atas ketertarikan Anda pada RS Brawijaya Saharjo. Kami senang memiliki kesempatan yang berkelanjutan untuk melayani Anda.</p>\n            <p>&nbsp;</p>\n            <p>&nbsp;</p>\n            <table border=\"3\">\n            <tbody>\n            <tr>\n            <td>\n            <p>Dear <strong>[[[SHARING_NAME]]],</strong> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\n            <p>&nbsp;</p>\n            <p>Thank you for your trust in Brawijaya Hospital Saharjo. Attached here with is the <strong>[[[SHARING_RESULT]]]</strong> exam result in the name of <strong>[[[SHARING_NAME]]]</strong> which was performed on <strong>January 20th, 2021.</strong></p>\n            <p>For your convenience, the NEW password format for viewing your radiological exam results is <strong>DDMMYYYY</strong>. Please use the password according to the format instructions below to access your examination results.</p>\n            <p>The password format for your new radiology exam is <strong>DDMMYYYY</strong>, where:</p>\n            <ul>\n            <li><strong>DD</strong> : two digits of your birth date, example: 01</li>\n            <li><strong>MM</strong> : two digits of your birth month, example: 01</li>\n            <li><strong>YYYY</strong> : four digits of your birth year, example: 1986</li>\n            </ul>\n            <p>&nbsp;</p>\n            <p>The password for radiology exam based on the example above is: 01011986.</p>\n            <p>The attached results are medical images and report of the examination.</p>\n            <p><strong>Url:</strong> <a href=\"[[[FILE_URL]]]\">[[[FILE_URL]]]</a></p>\n            <p>&nbsp;</p>\n            <p>Best regards,</p>\n            <p>&nbsp;</p>\n            <p>&nbsp;</p>\n            <h3>Radiology Department Brawijaya Hospital Saharjo</h3>\n            </td>\n            </tr>\n            </tbody>\n            </table>\n            <p><span style=\"color: #000000; background-color: #999999;\">RADIOLOGY DEPARTMENT BRAWIJAYA HOSPITAL SAHARJO Jl. Dr. Saharjo No.199, RW.1, tebet Bar., Kec. Tebet, Kota Jakarta Selatan, DKI Jakarta 12870 021- 3973-7890 0821-2221-1389 (Whats App Text Only)\n            Pesan dikirim dariRadMED on 20/01/2021 04:34:02\n            </span></p>\n            <p>Do not reply to this email, as it is not actively monitored. Please direct questions, suggestions or comments to website. Thank you for your interest in Brawijaya Saharjo Hospital. We are pleased to have the continued opportunity to serve you.</p>', 0, 0);
