INSERT INTO `site_config` VALUES (7, 'Site name', 'site_name', 'RadMED', 'Site name', '', 'string', 'Site Options', 5);
INSERT INTO `site_config` VALUES (9, 'Site theme', 'site_theme', 'evolution', 'Site template theme', 'SELECT folder_name AS itemValue FROM theme ORDER BY folder_name', 'select', 'System', 0);
INSERT INTO `site_config` VALUES (11, 'Date time format js', 'date_time_format_js', '%d-%m-%Y %H:%i', 'Date time format in javascript', '', 'string', 'Local', 10);
INSERT INTO `site_config` VALUES (20, 'Site language', 'site_language', 'Indonesia', 'Site language for text conversions <a href=\"translation_manage.php\">(manage languages)</a>', 'SELECT languageName AS itemValue FROM language ORDER BY languageName', 'select', 'Language', 0);
INSERT INTO `site_config` VALUES (21, 'Language show key', 'language_show_key', 'translation', 'Show translation value or key. (use \'key\' to debug translations, \'translation\' to show actual translated value. \'key title text\' to show the key as a title tag around the text content)', '[\"key\",\"translation\", \"key title text\"]', 'select', 'Language', 25);
INSERT INTO `site_config` VALUES (23, 'Stats only count unique', 'stats_only_count_unique', 'yes', 'Revisits in the same day, by the same IP address will not be counted on stats.', '[\"yes\", \"no\"]', 'select', 'Default', 0);
INSERT INTO `site_config` VALUES (24, 'Default email address from', 'default_email_address_from', 'noreply@radmed.co.id', 'Emails will be sent from', '', 'string', 'Email Settings', 12);
INSERT INTO `site_config` VALUES (31, 'Next check for file removals', 'next_check_for_file_removals', '1411399513', 'System value. The next time to delete any files which haven\'t recently been accessed. Timestamp. Do not edit.', '', 'integer', 'System', 0);
INSERT INTO `site_config` VALUES (37, 'Cost currency symbol', 'cost_currency_symbol', '$', 'The symbol to use for currency. i.e. $', '[\"$\", \"£\", \"€\"]', 'string', 'System', 5);
INSERT INTO `site_config` VALUES (38, 'Cost currency code', 'cost_currency_code', 'USD', 'The currency code for the current currency. i.e. USD', '[\"USD\", \"GBP\", \"EUR\"]', 'select', 'System', 10);
INSERT INTO `site_config` VALUES (42, 'Email method', 'email_method', 'smtp', 'The method for sending emails via the script.', '[\"php\",\"smtp\"]', 'select', 'Email Settings', 0);
INSERT INTO `site_config` VALUES (43, 'Email smtp host', 'email_smtp_host', 'mail.radmed.co.id', 'Your SMTP host if you\'ve selected SMTP email method. (leave blank is email_method = php)', '', 'string', 'Email Settings', 5);
INSERT INTO `site_config` VALUES (44, 'Email smtp port', 'email_smtp_port', '587', 'Your SMTP port if you\'ve selected SMTP email method. (Normally 25)', '', 'integer', 'Email Settings', 10);
INSERT INTO `site_config` VALUES (45, 'Email smtp requires auth', 'email_smtp_requires_auth', 'yes', 'Whether your SMTP server requires authentication.', '[\"yes\",\"no\"]', 'select', 'Email Settings', 20);
INSERT INTO `site_config` VALUES (46, 'Email smtp auth username', 'email_smtp_auth_username', 'noreply@radmed.co.id', 'Your SMTP username if SMTP auth is required.', '', 'string', 'Email Settings', 25);
INSERT INTO `site_config` VALUES (47, 'Email smtp auth password', 'email_smtp_auth_password', 'disana4misbah', 'Your SMTP password if SMTP auth is required.', '', 'string', 'Email Settings', 30);
INSERT INTO `site_config` VALUES (48, 'File url show filename', 'file_url_show_filename', 'no', 'Show the original filename on the end of the generated url.', '[\"yes\",\"no\"]', 'select', 'File Uploads', 25);
INSERT INTO `site_config` VALUES (49, 'Default file server', 'default_file_server', 'Radmed-Drive', 'The file server to use for all new uploads. Only used if \'active\' state and \'server selection method\' is \'specific server\'.', 'SELECT serverLabel AS itemValue FROM file_server LEFT JOIN file_server_status ON file_server.statusId = file_server_status.id WHERE statusId=2 ORDER BY serverLabel', 'select', 'File Uploads', 5);
INSERT INTO `site_config` VALUES (50, 'C file server selection method', 'c_file_server_selection_method', 'Specific Server', 'Server selection method. How to select the file server to use. If using \'until full\', you\'ll also need to set the file server priority on each.', '[\"Least Used Space\",\"Specific Server\",\"Until Full\"]', 'select', 'File Uploads', 0);
INSERT INTO `site_config` VALUES (51, 'File Download - Free User', 'free_user_show_captcha', 'no', 'Show the captcha after a free user sees the countdown timer.', '[\"yes\",\"no\"]', 'select', 'System', 3);
INSERT INTO `site_config` VALUES (54, 'Reserved usernames', 'reserved_usernames', 'admin|administrator|localhost|support|billing|sales|payments', 'Any usernames listed here will be blocked from the main registration. Pipe separated list.', '', 'string', 'Default', 0);
INSERT INTO `site_config` VALUES (58, 'Site admin email', 'site_admin_email', 'noreply@radmed.id', 'The email address all site admin emails will be sent.', '', 'string', 'Site Options', 15);
INSERT INTO `site_config` VALUES (61, 'Require user account download', 'require_user_account_download', 'no', 'Users must register for an account to download.', '[\"yes\",\"no\"]', 'select', 'System', 5);
INSERT INTO `site_config` VALUES (62, 'Generate upload url type', 'generate_upload_url_type', 'Medium Hash', 'What format to generate the file url in. Shortest will increment based on the previous upload. Hashed will create a longer random character hash.', '[\"Shortest\",\"Medium Hash\", \"Long Hash\"]', 'select', 'File Uploads', 20);
INSERT INTO `site_config` VALUES (70, 'Downloads track current downloads', 'downloads_track_current_downloads', 'yes', 'Whether to track current downloads/connections. Note: This should be enabled if you also want to limit concurrent download connections.', '[\"yes\",\"no\"]', 'select', 'File Downloads', 15);
INSERT INTO `site_config` VALUES (74, 'Session expiry', 'session_expiry', '86400', 'The amount of time a user can be inactive before their session will expire. In seconds. Default is 86400 (1 day)', '', 'integer', 'Site Options', 60);
INSERT INTO `site_config` VALUES (75, 'Logging log enabled', 'logging_log_enabled', 'yes', 'Whether to enable logging or not. The /logs/ folder should have write permissions on it. (chmod 755 or 777)', '[\"yes\",\"no\"]', 'select', 'Logs', 0);
INSERT INTO `site_config` VALUES (77, 'Logging log output', 'logging_log_output', 'yes', 'Whether to output the errors to screen. Always set this to \'no\' for your live site.', '[\"yes\",\"no\"]', 'select', 'Logs', 10);
INSERT INTO `site_config` VALUES (79, 'Logging log type', 'logging_log_type', 'All Error Types', 'The types of log messages to store in the log files. \'Serious Errors Only\' will log the important ones. Ensure logging is enabled for this setting to work.', '[\"Serious Errors Only\",\"Serious Errors and Warnings\",\"All Error Types\"]', 'select', 'Logs', 5);
INSERT INTO `site_config` VALUES (97, 'Premium user block account sharing', 'premium_user_block_account_sharing', 'no', 'Block paid account sharing. Accounts will only allow 1 login session. Any open sessions will be closed on a new login.', '[\"yes\",\"no\"]', 'select', 'System', 10);
INSERT INTO `site_config` VALUES (101, 'Language separate language images', 'language_separate_language_images', 'no', 'Use different images/css for each language. If yes, copy all the files from images/styles in /themes/blue_v2/ to /themes/blue_v2/[flag_code]/, keeping the folders. Replace \'[flag_code]\' with the 2 letter language flag code. i.e. /themes/blue_v2/es/', '[\"yes\",\"no\"]', 'select', 'Language', 15);
INSERT INTO `site_config` VALUES (102, 'Language user select language', 'language_user_select_language', 'yes', 'Give users the option to set their account language. Available as a drop-down in account settings. Automatically sets the language of the site on login.', '[\"yes\",\"no\"]', 'select', 'Language', 5);
INSERT INTO `site_config` VALUES (103, 'Maintenance mode', 'maintenance_mode', 'no', 'Whether to place the entire site into maintenance mode. Useful for site upgrades or server moves. Admin area is still accessible.', '[\"yes\",\"no\"]', 'select', 'Site Options', 25);
INSERT INTO `site_config` VALUES (106, 'Enable user registration', 'enable_user_registration', 'no', 'Whether to enable user registration on the site.', '[\"yes\",\"no\"]', 'select', 'System', 30);
INSERT INTO `site_config` VALUES (108, 'File manager default view', 'file_manager_default_view', 'icon', 'The default view for the file manager.', '[\"icon\", \"list\"]', 'select', 'File Manager', 0);
INSERT INTO `site_config` VALUES (109, 'Site contact form email', 'site_contact_form_email', 'noreply@radmed.id', 'The email address all contact form queries will be sent', '', 'string', 'Contact Form', 0);
INSERT INTO `site_config` VALUES (111, 'Performance js file minify', 'performance_js_file_minify', 'no', 'Whether to automatically group and minify js files. \'yes\' increases page load times. Use \'no\' if you have any issues or in dev. The \'cache\' folder must be writable.', '[\"yes\",\"no\"]', 'select', 'System', 35);
INSERT INTO `site_config` VALUES (124, 'Password policy min length', 'password_policy_min_length', '8', 'Minimum password length', '', 'integer', 'Password Policy', 0);
INSERT INTO `site_config` VALUES (125, 'Password policy max length', 'password_policy_max_length', '32', 'Maximum password length', '', 'integer', 'Password Policy', 5);
INSERT INTO `site_config` VALUES (126, 'Password policy min uppercase characters', 'password_policy_min_uppercase_characters', '1', 'Minimum upper case characters (set to 0 to ignore)', '', 'integer', 'Password Policy', 15);
INSERT INTO `site_config` VALUES (127, 'Password policy min numbers', 'password_policy_min_numbers', '1', 'Minimum numbers (set to 0 to ignore)', '', 'integer', 'Password Policy', 10);
INSERT INTO `site_config` VALUES (128, 'Password policy min nonalphanumeric characters', 'password_policy_min_nonalphanumeric_characters', '1', 'Minimum nonalphanumeric characters, i.e. symbols (set to 0 to ignore)', '', 'integer', 'Password Policy', 20);
INSERT INTO `site_config` VALUES (139, 'Security block ip login attempts', 'security_block_ip_login_attempts', '5', 'How many login attempts before an IP is blocked from logging in for 24 hours.', '', 'integer', 'Security', 30);
INSERT INTO `site_config` VALUES (140, 'Security send user email on password change', 'security_send_user_email_on_password_change', 'yes', 'Send user an email confirmation when they change their password in account settings.', '[\"yes\",\"no\"]', 'select', 'Security', 15);
INSERT INTO `site_config` VALUES (141, 'Security send user email on email change', 'security_send_user_email_on_email_change', 'yes', 'Send user an email confirmation when they change their email address in account settings.', '[\"yes\",\"no\"]', 'select', 'Security', 20);
INSERT INTO `site_config` VALUES (142, 'Email template header', 'email_template_header', '<html>\r\n    <head>\r\n        <meta http-equiv=\"Content-Type\" content=\"text/html; charset=UTF-8\">\r\n    </head>\r\n    <body style=\"background-color: #eee; padding: 0px; margin: 0px; font-family: Arial, Helvetica; font-size: 12px;\">\r\n        <div style=\"padding: 18px 18px 0px 18px; background-color: #ffffff;\">\r\n                <div style=\"background-image: url(\'[[[SITE_IMAGE_PATH]]]/main_logo_inverted.png\'); background-repeat: no-repeat; height: 45px; width: 100%; float: left;\"><!-- --></div>\r\n            <div style=\"clear: left;\"><!-- --></div>\r\n        </div>\r\n        <div style=\"background-color: #ffffff; padding: 18px 18px 25px 18px;\">', 'HTML code for the header of all emails. Test using the \'admin/_test_scripts/test_email.php\' script. Accepts the following placeholders for replacements: [[[SITE_NAME]]], [[[WEB_ROOT]]], [[[DATE_NOW]]], [[[TIME_NOW]]].', '', 'textarea', 'Email Settings', 40);
INSERT INTO `site_config` VALUES (143, 'Email template footer', 'email_template_footer', '        </div>\r\n        <div style=\"color: #aaa; font-size: 10px; padding: 18px; margin-left: auto; margin-right: auto;\">\r\n           RADIOLOGY DEPARTEMENT, BRAWIJAYA HOSPITAL SAHARJO\r\nJl. Dr. Saharjo No.199, RW.1, Tebet Bar., Kec. Tebet, Kota Jakarta Selatan, DKI Jakarta 12870\r\n021- 3973-7890\r\n0821-2221-1389 (Whats App Text Only)<br/><br/>\r\n            Tolong jangan balas email ini. Ini dibuat secara otomatis oleh sistem https://radmed.co.id/ sehingga alamat pengirim tidak dipantau untuk email. Silakan kirimkan permintaan melalui kami website jika Anda memiliki pertanyaan.<br/><br/>\r\n            Pesan dikirim dari https://radmed.co.id/ on [[[DATE_TIME_NOW]]]\r\n        </div>\r\n    </body>\r\n</html>', 'HTML code for the footer of all emails. Test using the \'admin/_test_scripts/test_email.php\' script. Accepts the following placeholders for replacements: [[[SITE_NAME]]], [[[WEB_ROOT]]], [[[DATE_NOW]]], [[[TIME_NOW]]].', '', 'textarea', 'Email Settings', 45);
INSERT INTO `site_config` VALUES (144, 'Email template enabled', 'email_template_enabled', 'yes', 'Whether to use the email header and footer html.', '[\"yes\",\"no\"]', 'select', 'Email Settings', 35);
INSERT INTO `site_config` VALUES (149, 'Purge deleted files period minutes', 'purge_deleted_files_period_minutes', '10080', 'How long to keep deleted files for on the server. On delete via the script UI they are moved into /files/_deleted/ then purged after this period. Useful for recovery if needed. Set in minutes. Default 24 hours, so 1440.', '', 'input', 'Site Options', 50);
INSERT INTO `site_config` VALUES (162, 'Premium user block account sharing', 'premium_user_block_account_sharing', 'no', 'Block paid account sharing. Accounts will only allow 1 login session. Any open sessions will be closed on a new login.', '[\"yes\",\"no\"]', 'select', 'System', 10);
INSERT INTO `site_config` VALUES (168, 'Remote url download in background', 'remote_url_download_in_background', 'no', 'Should remote file downloads should be done in the background? If yes you will need to setup the crontask /admin/tasks/process_remote_file_downloads.cron.php to run every minute.', '[\"no\", \"yes\"]', 'select', 'File Downloads', 10);
INSERT INTO `site_config` VALUES (169, 'Limit send via email per hour', 'limit_send_via_email_per_hour', '100', 'The maximum amount of emails that a user can send per hour from the \'send via email\' page.', '', 'string', 'Email Settings', 50);
INSERT INTO `site_config` VALUES (170, 'Force files private', 'force_files_private', 'no', 'Do you want to make all files uploaded private? All sharing links will be removed from the site pages and the users will only be able to download their own files.', '[\"yes\",\"no\"]', 'select', 'System', 0);
