ager.\",\"is_installed\":\"1\",\"date_installed\":null,\"plugin_settings\":\"{\\\"non_show_viewer\\\":1,\\\"free_show_viewer\\\":1,\\\"paid_show_viewer\\\":1,\\\"enable_preview_image\\\":1,\\\"preview_image_show_thumb\\\":1,\\\"auto_rotate\\\":1,\\\"supported_image_types\\\":\\\"jpg,jpeg,png,gif,wbmp\\\",\\\"enable_preview_document\\\":1,\\\"preview_document_pdf_thumbs\\\":1,\\\"preview_document_ext\\\":\\\"doc,docx,xls,xlsx,ppt,pptx,pdf,pages,ai,psd,tiff,dxf,svg,eps,ps,ttf,otf,xps\\\",\\\"enable_preview_video\\\":1,\\\"preview_video_ext\\\":\\\"mp4,flv,ogg\\\",\\\"preview_video_autoplay\\\":1,\\\"enable_preview_audio\\\":1,\\\"preview_audio_ext\\\":\\\"mp3\\\",\\\"preview_audio_autoplay\\\":1,\\\"caching\\\":1,\\\"image_quality\\\":90}\",\"plugin_enabled\":\"1\",\"load_order\":\"999\"},\"config\":{\"plugin_name\":\"File Previewer\",\"folder_name\":\"filepreviewer\",\"plugin_description\":\"Display files directly within the file manager.\",\"plugin_version\":\"5.0\",\"required_script_version\":\"5.0\",\"database_sql\":\"offline\\/database.sql\",\"fixedSizes\":[\"16x16\",\"32x32\",\"64x64\",\"125x125\",\"180x150\",\"250x250\",\"300x250\",\"120x240\",\"160x600\",\"500x500\",\"800x800\"],\"scaledPercentages\":[\"10\",\"25\",\"35\",\"50\",\"70\",\"85\"]}}}', 'Used internally by the system to store a cache of the plugin settings.', '', 'string', 'System', 0);
