INSERT INTO `site_config` VALUES (206, 'User Session Type', 'user_session_type', 'Local Sessions', 'Login session type. If you are using any \"Direct\" file servers, that must be \"Database Sessions\", using \"Local Sessions\" will break cross server support. If you enable a \"Direct\" file server, this is automatically changed to \"Database Sessions\". After changing you will need to re-login.', '[\"Local Sessions\", \"Database Sessions\"]', 'select', 'Site Options', 59);
